BEGIN TRANSACTION;
CREATE TABLE "plataforma_profesor" ("user_id" integer NOT NULL PRIMARY KEY REFERENCES "auth_user" ("id"), "fechaNacimiento" date NOT NULL, "tipoDocumento" varchar(10) NOT NULL, "genero" varchar(50) NOT NULL);
CREATE TABLE "plataforma_horario" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "dia" varchar(20) NOT NULL, "horaInicio" time NOT NULL, "horaFin" time NOT NULL, "idCurso_id" integer NOT NULL REFERENCES "plataforma_curso" ("id"));
CREATE TABLE "plataforma_grupo" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "idCurso_id" integer NOT NULL REFERENCES "plataforma_curso" ("id"), "idEstudiante_id" integer NOT NULL REFERENCES "plataforma_estudiante" ("user_id"));
CREATE TABLE "plataforma_estudiante" ("user_id" integer NOT NULL PRIMARY KEY REFERENCES "auth_user" ("id"), "tipoDocumento" varchar(10) NOT NULL, "fechaNacimiento" date NOT NULL, "genero" varchar(1) NOT NULL, "direccion" varchar(50) NOT NULL, "barrio" varchar(50) NOT NULL, "zona" varchar(50) NOT NULL, "comuna" varchar(50) NOT NULL, "telefonoFijo" integer NOT NULL, "telefonoCelular" integer NOT NULL, "grupoEtnico" varchar(50) NOT NULL, "condicion" varchar(50) NOT NULL, "seguridadSocial" varchar(50) NOT NULL, "enviarInfoAlCorreo" bool NOT NULL, "documento" varchar(100) NOT NULL);
CREATE TABLE "plataforma_datosfamiliamenor" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombrePadre" varchar(50) NOT NULL, "nombreMadre" varchar(50) NOT NULL, "telefonoPadre" integer NOT NULL, "telefonoMadre" integer NOT NULL, "institucionEducativa" varchar(50) NOT NULL, "grupo" varchar(50) NOT NULL, "jornada" varchar(50) NOT NULL, "nombreAcudiente" varchar(50) NOT NULL, "cedulaAcudiente" varchar(50) NOT NULL, "idEstudiante_id" integer NOT NULL UNIQUE REFERENCES "plataforma_estudiante" ("user_id"));
CREATE TABLE "plataforma_datosfamiliamayor" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombreContacto" varchar(50) NOT NULL, "telefonoContacto" integer NOT NULL, "desempe√±o" varchar(50) NOT NULL, "lugar" varchar(50) NOT NULL, "idEstudiante_id" integer NOT NULL UNIQUE REFERENCES "plataforma_estudiante" ("user_id"));
CREATE TABLE "plataforma_curso" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(50) NOT NULL, "esCerrado" bool NOT NULL, "idProfesor_id" integer NOT NULL REFERENCES "plataforma_profesor" ("user_id"), "numeroGrupo" integer NOT NULL);
CREATE TABLE "django_site" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(50) NOT NULL, "domain" varchar(100) NOT NULL UNIQUE);
CREATE TABLE "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id"), "user_id" integer NOT NULL REFERENCES "auth_user" ("id"), "action_time" datetime NOT NULL);
CREATE TABLE "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id"), "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id"));
CREATE TABLE "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id"), "group_id" integer NOT NULL REFERENCES "auth_group" ("id"));
CREATE TABLE "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "first_name" varchar(30) NOT NULL, "last_name" varchar(30) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "username" varchar(30) NOT NULL UNIQUE);
CREATE TABLE "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id"), "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id"), "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id"));
CREATE TABLE "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(80) NOT NULL UNIQUE);
